public String toString() {
  StringBuffer sb = new StringBuffer();
  sb.append("DelayedOr(");
  Iterator<TimedPlacementConstraint> it = getChildren().iterator();
  while (it.hasNext()) {
    TimedPlacementConstraint child = it.next();
    sb.append(child.toString());
    if (it.hasNext()) {
      sb.append(",");
    }
  }
  sb.append(")");
  return sb.toString();
}
